import React from 'react';
import { Link } from 'react-router-dom';

function Process() {
  return (
    <section className="process">
      <div className="container">
        <h2>Our Working Process</h2>
        <p>Know the whole process of how we work to provide the best car care services.</p>
        <Link to="/register" className="btn btn-success">Book Now</Link>
      </div>
    </section>
  );
}

export default Process;
